// patientspage.js

import React, { useState, useEffect } from "react";
import { useAuth } from "../path/to/useAuth"; // Adjust the import path accordingly
import axios from "axios";

function PatientsPage() {
  const { userEmail } = useAuth();
  const [latestResult, setLatestResult] = useState(null);

  useEffect(() => {
    const fetchLatestResult = async () => {
      try {
        const response = await axios.get(
          `http://localhost:3000/result/${userEmail}`
        );
        setLatestResult(response.data);
      } catch (error) {
        console.error("Failed to fetch latest result:", error);
      }
    };

    fetchLatestResult();
  }, [userEmail]);

  return (
    <div>
      <h1>Welcome, Patient!</h1>
      <p>Email: {userEmail}</p>
      {latestResult && (
        <div>
          <h2>Your Latest Result:</h2>
          <p>Status: {latestResult.Status}</p>
          <p>Prediction: {latestResult.Prediction}</p>
        </div>
      )}
    </div>
  );
}

export default PatientsPage;
